  document.getElementById("id").innerHTML = ID;

  return (
      <tbody>
        <tr>
          <th scope="row"><p id="id"></p></th>
          <td>{props.nama}</td>
          <td>{props.harga}</td>
          <td>{props.jumlah}</td>
          <td>{props.status}</td>
          <td>{props.tanggal}</td>
          <td>{props.hargaBayar}</td>
          <td>....</td>
        </tr>
      </tbody>
    );
  } 

export default ShowTransaksi;
